sys_variable_value.value:
(function execute(inputs, outputs) {
    gs.info("=== Auto Assignment Script Started ===");
    gs.info("Department SysId: " + inputs.departmentsysid);
    gs.info("ContactSupport SysId: " + inputs.contactsupportsysid);
    
    // Step 1: Find employee with lowest current_load in the department
    var emp = new GlideRecord('x_1745159_growhive_employees');
    emp.addQuery('emp_department', inputs.departmentsysid);
    emp.orderBy('current_load');  // Ascending order - lowest first
    emp.setLimit(1);  // Get only the first record
    emp.query();
    
    if (emp.next()) {
        var employeeSysId = emp.getUniqueValue();
        var currentLoad = parseInt(emp.getValue('current_load') || '0', 10);
        var employeeName = emp.getValue('emp_name') || 'Unknown';
        
        gs.info("Found Employee: " + employeeName + " (SysId: " + employeeSysId + ")");
        gs.info("Current Load: " + currentLoad);
        
        // Step 2: Update employee's current_load (increment by 1)
        emp.setValue('current_load', currentLoad + 1);
        var empUpdateResult = emp.update();
        
        if (empUpdateResult) {
            gs.info("Successfully updated employee load to: " + (currentLoad + 1));
        } else {
            gs.error("Failed to update employee load");
        }
        
        // Step 3: Update ContactandSupport record's assignedto field
        var contact = new GlideRecord('x_1745159_growhive_contactandsupport');
        if (contact.get(inputs.contactsupportsysid)) {
            gs.info("Found ContactSupport record: " + contact.getDisplayValue());
            
            // Set the assignedto field
            contact.setValue('assignedto', employeeSysId);
            
            // Optional: Update status to show it's been assigned
            // contact.setValue('status', 'In Progress');
            
            var contactUpdateResult = contact.update();
            
            if (contactUpdateResult) {
                gs.info("Successfully assigned contact to employee: " + employeeName);
                gs.info("AssignedTo field updated with SysId: " + employeeSysId);
                
                // Set successful outputs
                outputs.employeeSysId = employeeSysId;
                outputs.employeeName = employeeName;
                outputs.updatedLoad = currentLoad + 1;
                outputs.success = true;
                outputs.message = "Successfully assigned to " + employeeName;
                
            } else {
                gs.error("Failed to update ContactSupport record");
                outputs.success = false;
                outputs.error = "Failed to update ContactSupport record";
            }
            
        } else {
            gs.error("ContactSupport record not found for SysId: " + inputs.contactsupportsysid);
            outputs.success = false;
            outputs.error = "ContactSupport record not found";
        }
        
    } else {
        gs.warn("No employee found in department: " + inputs.departmentsysid);
        outputs.success = false;
        outputs.error = "No employee found for the given department";
    }
    
    gs.info("=== Auto Assignment Script Ended ===");
    
})(inputs, outputs);

